import React from "react"

export default function Star(props) {
    const starIcon = props.isFavorite ? "star-filled.jpg" : "star-empty.png"
    return (
        <img 
            src={`../images/${starIcon}`} 
            className="card--favorite"
            onClick={props.handleClick}
        />
    )
}
